create table company_profile.brand_supplement (
sub_brand_id int(10) unsigned NOT NULL AUTO_INCREMENT,
brand_id int(10), 
company_name varchar(256), 
brand_supplement_name varchar(32),
PRIMARY KEY (`sub_brand_id`)
);


